var Roblox = Roblox || {};
Roblox.LangDynamic = Roblox.LangDynamic || {};
Roblox.LangDynamic["Feature.Screentime"] = {"Description.TimeWarning":"Warning: Excessive experience use can interfere with normal daily life. You have played on Roblox for {NumberOfHours} hour(s).","Description.CurfewMessage":"You cannot visit Roblox at this time. \nYour parent or guardian can change additional restriction hours under Parental Controls in Settings.","Description.CurfewMessageTitle":"Playtime Restricted","Description.TimeWarningTitle":"Playtime Warning","Heading.ScreentimeLimitDialog":"Screen time limit reached","Content.ScreentimeLimitDialog":"You've reached your daily screen time limit. Come back tomorrow to access Roblox again.","Description.ScreentimeLimit":"Set a daily limit on the time your child spends on Roblox.","Label.DailyLimit":"Daily limit","Label.NoLimit":"No Limit","Label.Hours":"hours","Label.Minutes":"minutes","Label.Hour":"hour","Heading.Screentime":"Screen time","Label.Screentime":"Screen time","Description.RequestScreentimeLimitUpdate":"To change your screen time limit, you need parent permission.","Label.Minute":"minute","Label.Options":"Add more time","Label.FifteenMoreMinutes":"15 more minutes","Label.FiveMoreMinutes":"5 more minutes","Description.MoreScreentimeDescription":"This extends your screen time limit temporarily"};
window.Roblox && window.Roblox.BundleDetector && window.Roblox.BundleDetector.bundleDetected("DynamicLocalizationResourceScript_Feature.Screentime");
